/*
 * FUNCTION: EDCS_to_FACC_MapClassificationCode
 */
EDCS_Status_Code
EDCS_to_FACC_MapClassificationCode
(
	EDCS_Classification_Code          ec_code,
	FACC_Feature_Mapping_Structure ** mapping_info_out_ptr
)
{
    EDCS_Status_Code status = EDCS_SC_SUCCESS;

    if (!class_mapping_initialized)
    {
        fprintf( stderr, "Error: Must call EDCS_to_FACC_InitMappingInfo() before using this function\n");
        status = EDCS_SC_OTHER_FAILURE;
    }
    else if (!mapping_info_out_ptr )
    {
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (!EDCS_ValidClassificationCode(ec_code))
    {
        status = EDCS_SC_INVALID_INPUT_CODE;
    }
    else
    {
        *mapping_info_out_ptr = &(EDCS_4px_Class_Mapping_Array[ec_code-1].entry);
    }
    return status;
} /* end EDCS_to_FACC_MapClassificationCode */

/*
 * FUNCTION: initialize_class_mapping
 *
 *   This is kind of silly but we don't want half the library
 *   working if it hasn't been initialized.  The attribute mapping
 *   is where the actual initialization has to take place.
 */
void
initialize_class_mapping(void)
{
    class_mapping_initialized = EDCS_TRUE;
} /* end initialize_class_mapping */


